css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("proxybay.co"){
table#searchResult td span,.hero-unit h2,.hero-unit p,table#searchResult tr a{
color:#bbb!important}
table#searchResult tr a:visited{
color:#088!important}
table#searchResult tr:not(.header):hover{
background-color:#444!important;
background:radial-gradient(ellipse farthest-corner at center bottom,hsl(220,99%,50%) 0%,transparent 99%),linear-gradient(180deg,#444 48%,#222 49%,#000 85%,#333)!important}
table#searchResult tr:not(.header):hover a{
color:#fff!important;
text-shadow:1px 1px #000!important}
table#searchResult tr:nth-child(2n){
background:#333!important}
table#searchResult tr:nth-child(2n+1),.hero-unit{
background:#222!important}
table#searchResult tr{
background:#222!important;
border-top: 1px solid #000!important;
border-bottom: 1px solid #555!important}}
